import React from 'react';
import logo from './logo.svg';
import axios from 'axios';
import './App.css';


class App extends React.Component {
  render(){
    return(
      <div>
        componentDidMount() {

axios.get('http://localhost:8080/poc-0.0.1-SNAPSHOT/getProp')
    .then(response => {
        this.setState({ exercises: response.data })
    })
    .catch((error) => {
        console.log(error);
    })
  }
      </div>
    );
  }
}


